        <div class="card-body">
          <a href="#" class="card-link">Card link</a>
          <a href="#" class="card-link">Another link</a>
        </div>
      </div>
    )
  })


  return(
    <React.Fragment>
      {setStore}
    </React.Fragment>
  )
}

export default ItemCard;
